import React from 'react';
import './Footer.css';

const Footer = () => (
  <footer className="footer">
    <div className="footer-links">
      <a href="#">COOKIE SETTINGS</a>
      <a href="#">PRIVACY AND COOKIES POLICY</a>
      <a href="#">TERMS OF USE</a>
    </div>
  </footer>
);

export default Footer;
